import React from "react";
import "./TimeLine.css";

function TimeLine() {
  return (
    <div className="timeline_container">
      <img className="timeline_left" src="images/timeline-left.png"></img>
      <img className="timeline_center" src="images/timeline-center.png"></img>
      <img className="timeline_right" src="images/timeline-right.png"></img>
      <div className="timeline_mobile">
        <div className="timeline_line"></div>
        <ul>
          <li>
            {" "}
            <img
              className="timeline_right"
              src="images/timeline-right.png"
            ></img>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default TimeLine;
